import React from 'react';
import './App.css';

import { Route, Router} from 'react-router-dom';
import Login from './containers/Authentication/Login/Login'


const App = () => {
  return (
    <Router>
      <Route exact path="/login" component={Login}/>
    </Router>
  )
}

export default App;
